import React from "react";
import Newslist from "./newslist";
import { useState } from "react";

export default function Main() {
  const [news, setnews] = useState('')
  const url =
    "https://newsapi.org/v2/top-headlines?country=us&category=business&apiKey=246319e5bf884ea5814b2a0b9f940a09";
  const getnews = fetch(url);

    setnews(getnews)
  return (
    <div className="container h-100 w-100">
      <div className="row">
     {
        news.map(news => {
            <Newslist key={news.source.id} imageURL={news.urlToImage} title={news.title} desc={news.description}/>
        })
     }
      </div>
    </div>
  );
}
